    const todosList = [
      {id: 1,content: "店予約する"},
      {id: 2,content: "卵買う"},
      {id: 3,content: "郵便出す"},
    ];
    const newTodosList = [...todosList]
    return(
      <>
        {
          newTodosList.map(todo =>{
            return(
            <div>
              <button>完了</button>
              {todo.content}
            </div>
            )
          })
        }
      </>
    )
  };



export default List;
